import React from 'react';
import {Text, View, Button} from 'react-native';


function CardDetails(){
    
  return (
    <View
      style={{
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
      }}>
        <Text>this is card details</Text>
        
      
    </View>
  );
};
export default CardDetails;
